import "../market store/market.css"
import Nav from "../Nav bar/Nav";
import Footer from "../footer section/footer";
import Box from "../box product/box";
import adv from "../Home page/"


function Market() {
    const shop1 =[

        {"id": "1", "brand": "Laptop Hp", "model": "Laptop", "price": "$499", "image_url": laptop},
        {"id": "2", "brand": "iphone14 pro", "model": "Iphone", "price": "$599", "image_url": iphone13},
        {"id": "3", "brand": "iphone 15 pro", "model": "Iphone", "price": "$699", "image_url": iphone133},
        {"id": "4", "brand": "iphone 13 pro max", "model": "Iphone", "price": "$799", "image_url": iphone4},
        {"id": "5", "brand": "Iphone 15 pro max", "model": "Iphone", "price": "$799", "image_url": iphone5},
    ]
    const shop2 =[

        {"id": "1", "brand": "Laptop Dell", "model": "Laptop", "price": "$699", "image_url": laptop2},
        {"id": "2", "brand": "Dell pro", "model": "Laptop", "price": "$599", "image_url": laptop3},
        {"id": "3", "brand": "Samsaung pro", "model": "SAmsung", "price": "$699", "image_url": samsung},
        {"id": "4", "brand": "Camera hp2 ", "model": "Camera", "price": "$399", "image_url": camera1},
        {"id": "5", "brand": "Camera pro", "model": "Camera", "price": "$799", "image_url": camera2},
    ]
    return (

      <div className="market">
        <Nav/>
        <section id="sec1">
            <h1>Visit Shop</h1>
            <img src="" alt="" />

        </section>

             <Footer/>

      </div>

    );
  }

  export default Market;
